import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';



function Navigation (){
    return (
        <div>
            <div>Cloud Icon</div>
            <h1>School in the Cloud</h1>
            <Link to='/login'>Login</Link>
            <Link to='/sign-up'>Sign-Up</Link>
        </div>
    )
}


export default Navigation;
